import Link from 'next/link'

const About = () =>{
    return(
        <>
         <nav>
            <Link href={'/'}><a>Home</a></Link>
            <Link href={'/about'}><a>About</a></Link>
            <Link href={'/contact'}><a>Contact Me</a></Link>
        </nav>
            <h1>I'm a New Software Enginner</h1>
        </>
    )
 }

 export default About;
